def get_individual_lst(det_dic):
    wrd_lst = []
    aoa_lst = []
    freq_lst = []
    for word in det_dic:
        wrd_lst.append(word)
        freq_lst.append(det_dic[word]["Freq"])
        aoa_lst.append(det_dic[word]["AoA"])

    return freq_lst, aoa_lst, wrd_lst



